import React from 'react'
import icon from '../img/icon.png'

export default function Home() {
  return (
    <div>
      {/* title */}
      <header className="flex flex-row items-end px-72 h-screen shadow-inner 
                         bg-fixed bg-center bg-cover bg-img-lg bg-img-sm sm:pb-48">
        <div className="title-sm title-lg prim-color flex justify-">
          <img src={icon} alt='icon'/>
          <h1 className='tracking-wide font-sulangor'>Pemilihan Raya Himakom 2022</h1>
        </div>
      </header>
    </div>
  )
}
